      "post": {
        "description": "Returns a data classification report. Includes snippet masking status.",
        "operationId": "get-classification-report-v2",
        "requestBody": {
          "content": {
            "application/json; charset=UTF-8": {
              "schema": {
                "$ref": "#/components/schemas/DLPInventoryResourceExplorerRequest"
              }
            }
          }
        },
        "responses": {
          "200": {
            "content": {
              "*/*": {
                "schema": {
                  "items": {
                    "$ref": "#/components/schemas/DLPInventoryObjectClassificationReportV2"
                  },
                  "type": "array"
                }
              }
            },
            "description": "success"
          },
          "400": {
            "description": "missing_required_parameter / invalid_parameter_value / internal_error / violates_minimum_alert_dismiss_duration_time"
          },
          "500": { "description": "internal_error" }
        },
        "security": [{ "x-redlock-auth": [] }],
        "summary": "Get Classification Report V2",
        "tags": ["Data Security Inventory"],
        "x-codeSamples": [
          {
            "lang": "Python + Requests",
            "source": "import requests\n\nurl = \"https://api.prismacloud.io/dlp/api/v1/inventory/object/data-classification/reportv2\"\n\npayload = {\n    \"objectId\": \"string\",\n    \"tenantId\": \"string\"\n}\nheaders = {\n    \"content-type\": \"application/json; charset=UTF-8\",\n    \"x-redlock-auth\": \"REPLACE_KEY_VALUE\"\n}\n\nresponse = requests.request(\"POST\", url, json=payload, headers=headers)\n\nprint(response.text)"
